import React from 'react';
import ReactDOM from 'react-dom';
import Heading from './Heading';
import Para from './Para';


ReactDOM.render(
  <>
   <Heading/>
    <Para/>
    <ol>
      <li>Rajesh</li>
      <li>Debid</li>
      <li>Ac Rajan</li>
      <li>Sagun</li>
    </ol>
  </>
  ,document.getElementById('root')
);
